uid: microsoft.quantum.math.timesi
name: TimesI
type: function
namespace: microsoft.quantum.math
summary: 返回两个输入的乘积。
syntax: 'function TimesI (a : Int, b : Int) : Int'
input:
  content: '(a : Int, b : Int)'
  types:
  - name: a
    summary: 要相乘的第一个输入 $a $。
    isPrimitive: true
    uid: Int
  - name: b
    summary: 要相乘的第二个输入 $b $。
    isPrimitive: true
    uid: Int
output:
  content: Int
  types:
  - summary: Product $a \times b $。
    isPrimitive: true
    uid: Int
